from typing import List
from collections import defaultdict, Counter

def numMatchingSubsq(s, words) -> int:
    res = 0
    dict_word = Counter(words)
    for key, values in dict_word.items():
        i, j = 0, 0
        while i < len(s) and j  < len(key):
            if s[i] == key[j]:
                j += 1
            i += 1
        if j == len(key):
            res = res + values
    return res
        
print(numMatchingSubsq("abcde", ["a","bb","adc","ace"]))
